drop table telemedicine_national_estimate;
drop table telemedicine_by_age;
drop table telemedicine_by_state;
purge recyclebin;

CREATE TABLE telemedicine_national_estimate (
    ID NUMBER NOT NULL,
    Group_name VARCHAR2(100) NOT NULL,
    State_ VARCHAR2(100) NOT NULL,
    Subgroup VARCHAR2(100) NOT NULL,
    Time_Period NUMBER NOT NULL,
    Time_Period_Label VARCHAR2(100),
    Time_Period_Start_Date VARCHAR2(10),
    Time_Period_End_Date VARCHAR2(10),
    Value_ NUMBER,
    Low_CI NUMBER,
    High_CI NUMBER,
    PRIMARY KEY (ID)
);



